export enum StatementTypes {
  RequestStatements = 'STATEMENT_REQUEST',
  SuccessStatements = 'STATEMENT_SUCCESS',
  FaledStatements = 'STATEMENT_FAILED',
  AddStatements = 'ADD_STATEMENT',
  ChangeItem = 'CHANGE_STATEMENT',
  DeleteItem = 'DELETE_STATEMENT'
}

export default StatementTypes;
